import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Products.css"; // Your custom CSS file
import featuredImage from "../assets/featured-product.jpg"; // Adjust the path as needed

const Products = () => {
  const [selectedCategory, setSelectedCategory] = useState("all");
  const [searchQuery, setSearchQuery] = useState("");
  const [sortBy, setSortBy] = useState("featured");

  const categories = [
    { id: "all", name: "All Products", count: 120 },
    { id: "electronics", name: "Electronics", count: 35 },
    { id: "clothing", name: "Clothing", count: 28 },
    { id: "home", name: "Home & Garden", count: 22 },
    { id: "sports", name: "Sports & Fitness", count: 18 },
    { id: "beauty", name: "Beauty & Health", count: 17 },
  ];

  const generateProducts = () => {
    const productNames = [
      "Wireless Headphones", "Smart Watch", "Coffee Maker", "Messenger Bag",
      "Bluetooth Speaker", "Yoga Mat", "Knife Set", "Running Shoes", "Moisturizer",
      "Desk Lamp", "Charger", "Gaming Mouse", "T-Shirt", "Protein Powder", "Oil Set"
    ];
    const badges = ["Best Seller", "New", "Sale"];
    const categoryTypes = ["electronics", "clothing", "home", "sports", "beauty"];

    return Array.from({ length: 30 }, (_, i) => ({
      id: i + 1,
      name: productNames[i % productNames.length],
      price: Math.floor(Math.random() * 300) + 20,
      rating: (Math.random() * 2 + 3).toFixed(1),
      reviews: Math.floor(Math.random() * 200) + 10,
      image: featuredImage,
      badge: badges[Math.floor(Math.random() * badges.length)],
      category: categoryTypes[Math.floor(Math.random() * categoryTypes.length)],
      inStock: Math.random() > 0.1,
    }));
  };

  const products = generateProducts();

  const filteredProducts = products.filter((product) => {
    const matchCategory = selectedCategory === "all" || product.category === selectedCategory;
    const matchSearch = product.name.toLowerCase().includes(searchQuery.toLowerCase());
    return matchCategory && matchSearch;
  });

  const sortedProducts = [...filteredProducts].sort((a, b) => {
    switch (sortBy) {
      case "price-low": return a.price - b.price;
      case "price-high": return b.price - a.price;
      case "rating": return b.rating - a.rating;
      default: return 0;
    }
  });

  return (
    <div className="products-container">
      <h1 className="products-title">All Products</h1>
      <p className="products-subtitle">Discover our full collection</p>

      {/* Filters */}
      <div className="products-filters">
        <input
          className="search-input"
          type="text"
          placeholder="Search products..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />

        <select className="sort-select" value={sortBy} onChange={(e) => setSortBy(e.target.value)}>
          <option value="featured">Featured</option>
          <option value="price-low">Price: Low to High</option>
          <option value="price-high">Price: High to Low</option>
          <option value="rating">Top Rated</option>
        </select>
      </div>

      {/* Categories */}
      <div className="category-buttons">
        {categories.map((cat) => (
          <button
            key={cat.id}
            className={`category-button ${selectedCategory === cat.id ? "active" : ""}`}
            onClick={() => setSelectedCategory(cat.id)}
          >
            {cat.name} ({cat.count})
          </button>
        ))}
      </div>

      {/* Product Grid */}
      <div className="product-grid">
        {sortedProducts.map((product) => (
          <div className="product-card" key={product.id}>
            <img src={product.image} alt={product.name} className="product-img" />
            <div className="badge">{product.badge}</div>
            <h3 className="product-name">{product.name}</h3>
            <p className="product-price">${product.price}</p>
            <p className="product-rating">Rating: {product.rating} ‚≠ê</p>
            <button className="add-btn" disabled={!product.inStock}>
              {product.inStock ? "Add to Cart" : "Out of Stock"}
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
